    Method called by <xref uid="com.fasterxml.jackson.databind.DeserializationContext" data-throw-if-not-resolved="false">DeserializationContext</xref> at the end of deserialization if this Object Id was not resolved during normal processing. Call is made to allow custom implementations to use alternative resolution strategies; currently the only way to make use of this functionality is by sub-classing <xref uid="com.fasterxml.jackson.databind.deser.impl.ReadableObjectId" data-throw-if-not-resolved="false">ReadableObjectId</xref> and overriding this method.


    Default implementation simply returns `false` to indicate that resolution attempt did not succeed.
